pragma solidity ^0.4.17;


library MapUtil {
    uint constant private NULL = 0;

    struct Node {
        uint prev;
        uint next;
    }

    struct Data {
        mapping(uint => Node) list;
        mapping(uint => bool) set;
        uint firstNodeId;
        uint lastNodeId;
        uint len;
    }

    function insertAfter(Data storage self, uint afterId, uint id) public {
        self.list[id].prev = afterId;
        if (self.list[afterId].next == NULL) {
            self.list[id].next = 0;
            self.lastNodeId = id;
        } else {
            self.list[id].next = self.list[afterId].next;
            self.list[self.list[afterId].next].prev = id;
        }
        self.list[afterId].next = id;
    }

    function insertBefore(Data storage self, uint beforeId, uint id) public {
        self.list[id].next = beforeId;
        if (self.list[beforeId].prev == NULL) {
            self.list[id].prev = 0;
            self.firstNodeId = id;
        } else {
            self.list[id].prev = self.list[beforeId].prev;
            self.list[self.list[beforeId].prev].next = id;
        }
        self.list[beforeId].prev = id;
    }

    function insertBeginning(Data storage self, uint id) public {
        if (self.firstNodeId == NULL) {
            self.firstNodeId = id;
            self.lastNodeId = id;
            self.list[id] = Node({ prev: 0, next: 0 });
        } else
            insertBefore(self, self.firstNodeId, id);
    }

    function insertEnd(Data storage self, uint id) public {
        if (self.lastNodeId == NULL) insertBeginning(self, id);
        else
            insertAfter(self, self.lastNodeId, id);
    }

    function push(Data storage self, uint id) public {
        insertEnd(self, id);
        // self.len++;
    }

    function remove(Data storage self, uint id) public returns (bool) {
        if (!self.set[id]) return false;

        uint nextId = self.list[id].next;
        uint prevId = self.list[id].prev;

        if (prevId == NULL) self.firstNodeId = nextId; //first node
        else
            self.list[prevId].next = nextId;

        if (nextId == NULL) self.lastNodeId = prevId; //last node
        else
            self.list[nextId].prev = prevId;

        // self.len--;
    }

    function getAll(Data storage self) public view returns (uint[10]) {
        uint[10] memory arr;
        uint id = self.firstNodeId;
        for (uint i = 0; i < 10; i++) {
            arr[i] = 1111;
            id = self.list[id].next;
        }
        return arr;
    }
}
